import axios from "axios";

// eslint-disable-next-line
const postSingup = async (body) => {

    axios({
        method: 'post',
        url: 'http://food-power.glitch.me/sign-up',
        headers: {},
        data: body
    })
        .then(function (response) {
            return response.data;
        });
};

// const signupPost = async (body) => {
//     const response = await axios.post('http://food-power.glitch.me/sign-up', { body })
//     return response;
// };

export default postSingup;
